import React from 'react'
import Card from './Components/Card'
import Data from './Data'


const App=()=>{
     <div>
        <h1 className="headingStyle">List of Top 5 series</h1>
     {Data.map((val)=>{
    return (
        <Card
        key={val.id}
        sname={Data[val].sname}
        imgscr={Data[val].imgscr}
        title={Data[val].title}
        />
    );
})}
    </div>
}
export default App;
